import React from 'react';
class Work extends React.Component{
	constructor(props){
		super(props);
	}
	render(){
		return(
			<div className="section section-work">
				<div className="section-work--dark section-work--image"></div>
				<div className="section-work--light section-work--copy"><h1>Development of Unislim's online services. </h1>
				<p>Including a rapid response solution to the effect of Covid 19 on their services.</p>
				<p>Assisted in UX testing, UX research analysis, design, and primarily responsible for development. Membership area of the website integrates with Unislim's base membershipt software and mobile app.</p>
				<a className="section-work--link" href="https://unislim.com">Go to Project</a>
				</div>
			</div>
			);
	}
}
export default Work;
